import "./App.css";
import TextField from "@mui/material/TextField";
import { React, useState } from "react";
import { getMoviesList, getMovieID } from "./Controller/MoviesController";
import { Navbar } from "react-bootstrap";
const App = () => {
  const [searchBox, setSearchBox] = useState("");
  const [moviesList, setMoviesList] = useState([]);

  return (
    <div className="App">
      <Navbar/>
      <div className="main">
        <input
          type="search"
          placeholder="Search here"
          onChange={async (word) => {
            setSearchBox(word.target.value);
            await getMoviesList(word.target.value)
              .then((res) => {
                setMoviesList(res);
              })
              .catch((err) => {
                console.log("Error: " + err);
              });
            //await getMovieID("tt0113312");
          }}
          value={searchBox}
        />
      </div>
      {moviesList.map((item) => (
        <li key={item.id}>
          {item.title} - {item.id}
        </li>
      ))}
    </div>
  );
};

export default App;
